public void applicationMasterFinished(ApplicationAttemptId appAttemptId) {
  this.writeLock.lock();
  try {
    LOG.info("Application finished, removing password for "
        + appAttemptId);
    this.appAttemptSet.remove(appAttemptId);
  } finally {
    this.writeLock.unlock();
  }
}
